import React from 'react';

function App() {
  console.log('App component is rendering');

  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#0D1117',
      color: '#E0E0E0',
      padding: '20px',
      fontFamily: 'Arial, sans-serif'
    }}>
      <h1 style={{ 
        fontSize: '3rem', 
        fontWeight: 'bold', 
        textAlign: 'center',
        marginBottom: '20px',
        color: '#00FFFF'
      }}>
        BracketsTV
      </h1>
      <p style={{ 
        fontSize: '1.2rem', 
        textAlign: 'center',
        opacity: 0.6
      }}>
        React app is working! Check the console for "App component is rendering"
      </p>
    </div>
  );
}

export default App;
